(def teams
  (with-open [in (clojure.java.io/reader "march-machine-learning-mania-2016-v2/Teams.csv")]
    (doall
      (->> (rest (csv/read-csv in))
           (reduce (fn [m [id name]] (assoc m (read-string id) name)) {})))))

(take 10 teams)
