(def seeds
  (with-open [in (clojure.java.io/reader "march-machine-learning-mania-2016-v2/TourneySeeds.csv")]
    (doall
      (->> (rest (csv/read-csv in))
           (reduce (fn [m [season seed team]]
                     (assoc-in m [(read-string season) seed] (read-string team)))
                   {})))))

(seeds 2012)
