(def slots
  (with-open [in (clojure.java.io/reader "march-machine-learning-mania-2016-v2/TourneySlots.csv")]
    (doall
      (->> (rest (csv/read-csv in))
           (reduce (fn [m [season slot hi lo]]
                     (let [keys [(read-string season) slot]
                           val [hi lo]]
                       (assoc-in m keys val)))
                   {})))))

(slots 2012)
