(def tourney-results
  (with-open [in (clojure.java.io/reader "march-machine-learning-mania-2016-v2/TourneyCompactResults.csv")]
    (doall
      (->> (rest (csv/read-csv in))
           (reduce (fn [m [season daynum wteam wscore lteam lscore wloc numot]]
                     (let [key (read-string season)
                           val (map read-string [wteam wscore lteam lscore])]
                       (assoc m key (if (contains? m key) (conj (get m key) val) [val]))))
                   {})))))

(tourney-results 2012)
