(def year 2012)

; round 1 matchups
(doseq [[round [hi lo]] (slots year)]
  (let [hiteam (get-in seeds [year hi])
        loteam (get-in seeds [year lo])]
    (when (and hiteam loteam)
      (println hiteam loteam))))
